INSERT INTO `pages` VALUES (1,'terms-and-conditions','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n  <meta charset=\"UTF-8\">\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n  <title>Terms and Conditions</title>\r\n  <style>\r\n    body {\r\n      font-family: Arial, sans-serif;\r\n      margin: 20px;\r\n    }\r\n    .container {\r\n      max-width: 800px;\r\n      margin: 0 auto;\r\n    }\r\n    h1, h2 {\r\n      color: #333;\r\n    }\r\n    p {\r\n      color: #666;\r\n      line-height: 1.6;\r\n    }\r\n  </style>\r\n</head>\r\n<body>\r\n  <div class=\"container\">\r\n    <h1>Terms and Conditions</h1>\r\n    <p>Welcome to our mobile application. If you continue to browse and use this application, you are agreeing to comply with and be bound by the following terms and conditions of use, which together with our privacy policy govern [Your Company Name]\'s relationship with you in relation to this application. If you disagree with any part of these terms and conditions, please do not use our application.</p>\r\n    \r\n    <h2>Use of the Application</h2>\r\n    <p>This application is subject to the following terms of use:</p>\r\n    <ul>\r\n      <li>The content of the pages of this application is for your general information and use only. It is subject to change without notice.</li>\r\n      <li>Neither we nor any third parties provide any warranty or guarantee as to the accuracy, timeliness, performance, completeness or suitability of the information and materials found or offered on this application for any particular purpose.</li>\r\n      <li>You acknowledge that such information and materials may contain inaccuracies or errors and we expressly exclude liability for any such inaccuracies or errors to the fullest extent permitted by law.</li>\r\n    </ul>\r\n    \r\n    <h2>Privacy</h2>\r\n    <p>Your use of this application is also subject to the terms of our Privacy Policy. Please review our Privacy Policy, which also governs the application and informs users of our data collection practices.</p>\r\n    \r\n    <h2>Changes to These Terms</h2>\r\n    <p>We may update our Terms and Conditions from time to time. We will notify you of any changes by posting the new Terms and Conditions on this page. You are advised to review this Terms and Conditions periodically for any changes. Changes to this Terms and Conditions are effective when they are posted on this page.</p>\r\n    \r\n    <h2>Contact Us</h2>\r\n    <p>If you have any questions about these Terms, please contact us at support@yourcompany.com.</p>\r\n  </div>\r\n</body>\r\n</html>',1,'2024-05-18 00:59:16','2024-12-15 10:56:47'),(2,'about-us','<p><img src=\"data:image/jpeg;base64,\" data-filename=\"download.jpg\" style=\"width: 968.094px;\">\r\n</p>\r\n<h1><span style=\"font-family: inherit; font-size: 1.875rem;\">Our Mission</span><br></h1>\r\n<p>Welcome to our community! Our\r\n  mission is to bring together car enthusiasts from around the world, providing a platform for sharing knowledge,\r\n  experiences, and passion for automobiles.</p>\r\n<h2>Our Story</h2>\r\n<p>Founded in 2021, we started as a\r\n  small group of car lovers who wanted to create a space where people could come together to discuss and share their\r\n  love for cars. Today, we have grown into a thriving community with members from all over the globe.</p>\r\n<h2>Our Team</h2>\r\n<p>Our team is composed of\r\n  dedicated professionals who are passionate about cars and technology. We work tirelessly to provide our members with\r\n  the best experience possible, whether it\'s through our website, mobile app, or community events.</p>\r\n<h2>Contact Us</h2>\r\n<p>If you have any questions or\r\n  would like to learn more about our community, feel free to reach out to us at contact@ourcommunity.com.</p>',1,'2024-05-18 00:59:16','2024-09-17 16:49:14');
